#ifndef __SPINLOCK_ARM_H__
#define __SPINLOCK_ARM_H__

static __inline__ void spin_lock (volatile int* lock) {
    unsigned long tmp;
  
         __asm__ __volatile__(
"1:     ldrex   %0, [%1]\n"
"       cmp     %0, #0\n"
"       strexeq %0, %2, [%1]\n"
"       cmpeq   %0, #0\n"
"       bne     1b\n"
"       dmb\n"
        : "=&r" (tmp)
        : "r" (lock), "r" (1)
        : "cc");

}

static __inline__ void spin_unlock (volatile int* lock) {


     __asm__ __volatile__(
"       dmb\n"
"       str     %1, [%0]\n"
        :
        : "r" (lock), "r" (0)
        : "cc");
}


static __inline__ int trylock (volatile int* lock) {
        unsigned long tmp;

        __asm__ __volatile__(
"       ldrex   %0, [%1]\n"
"       cmp     %0, #0\n"
"       strexeq %0, %2, [%1]\n"
"       eor     %0, %0, #1\n"
"       bne     fail\n"
"       dmb\n"
"fail:     nop\n"
        : "=&r" (tmp)
        : "r" (lock), "r" (1)
        : "cc", "memory");

        return tmp;
}

#endif  // __SPINLOCK_ARM_H__
