void insertion(char* buf, char val, int length){
	int i, j;
	for(i=0;i<length;i++){
		if(buf[i]>val){
			break;
		}
	}
	for(j=length;j>i;j--){
		buf[j]=buf[j-1];
	}
	buf[i]=val;
}

int checkbuf(char* buf, char val, int length){
	int a;
	for(a=0;a<length;a++){
		if(buf[a]==val){
			return 1;
		}
	}
	return 0;
}

void initaprioriset(aprioriset** data, int length){
	(*data)=(aprioriset*)malloc(sizeof(aprioriset));
	(*data)->support=0;
	(*data)->length=length;
}

