	sprintf(cmd, "mv ./m5out/stats.txt ./m5out/decisiontree_%s_%d_%dMHz_%d.txt", funcname, numcpu, cpuhz, num);
	cycle = ispRunBinaryFileEx(device, pname, NULL, "output.txt", numcpu, clock);
