// run the downloaded binary program in ISSD
// simulation implementation
isp_int ispRunBinaryFile(isp_device_id device_id, const char* program_file_name, const char* program_argument, const char* program_output_file)
{
	char command[1024];
	if(program_argument)
		sprintf(command,"%s %s -n %d -c %s -o \"%s \" --output=%s > gem5_result.txt",GEM5_EXECFILE, GEM5_PLATFORM, GEM5_NUMPROCS,program_file_name, program_argument, program_output_file);
	else
		sprintf(command,"%s %s -n %d -c %s --output=%s > gem5_result.txt", GEM5_EXECFILE, GEM5_PLATFORM, GEM5_NUMPROCS, program_file_name, program_output_file);

	printf("%s\n",command);
	system(command);

	// read gem5_result.txt to obtain the isp program cycles and return it.
	// TODO ...
	int cycle;
	cycle = getTickCycle("gem5_result.txt");
	cycle += getTickCycle("io_stat.txt");

	return cycle;

}


int getTickCycle(const char* theFileName)
{
	char command[1024];

	sprintf(command, "grep Exiting %s | sed 's/^[A-z @]*//' > gem5_cycle.txt", theFileName);
	system(command);
	FILE* ifp;
	char buffer[1024];
	ifp = fopen("gem5_cycle.txt","r");
	int c, index=0;
	while((c=fgetc(ifp))!=EOF) {
		if(!isdigit(c)) {
			break;
		}

		buffer[index] = c;
		++index;
	}

	buffer[index] = 0;
	
	int cycle = 0;
	if(index>0) cycle = atoi(buffer);
	system("rm gem5_cycle.txt");
		

	sprintf(command,"rm %s", theFileName);
//	system(command);

	return cycle; 
}


// Smart Solid State System (S4)
// It is a socket server


#include "s4.h"

// unit is pico second
//#define S4_FLASH_READ_LATENCY 200000000
#define S4_FLASH_READ_LATENCY 0

int s4_tick_time; 

void s4_spend_time(int theTick)
{
	s4_tick_time += theTick;
}

void s4_init_simulation()
{
	s4_tick_time = 0;
}

void s4_wrapup_simulation()
{
	FILE* stat = fopen("io_stat.txt","w");
	fprintf(stat, "Exiting @ tick %d\n",s4_tick_time);
}

FILE *
s4_fopen(const char * filename, const char * mode)
{
        return fopen(filename,mode);
}

int
s4_fseek(FILE *stream, long offset, int whence)
{
        return fseek(stream, offset, whence);
}

void
s4_rewind(FILE *stream)
{
        (void)s4_fseek(stream, 0L, SEEK_SET);
}

size_t
s4_fread(void * ptr, size_t size, size_t nitems, FILE * stream)
{
        return fread(ptr,size,nitems,stream);
}

size_t
s4_pageread(size_t pageStartNumber, size_t numPages, FILE * stream)
{
	int n = s4_fread(&s4_buffer[pageStartNumber],sizeof(char), S4_PAGE_SIZE*numPages,stream);

	// modeling for clock tick delay
	// default read time for a page is  internally 200us
	s4_spend_time(S4_FLASH_READ_LATENCY);

	if(n%S4_PAGE_SIZE==0) return n/S4_PAGE_SIZE;
	else return (n/S4_PAGE_SIZE)+1;
}

size_t
s4_fwrite(const void * ptr, size_t size, size_t nitems, FILE * stream)
{
        return fwrite(ptr,size,nitems,stream);
}
